import './List.scss';

const List = (props)=>{
    return (
        <div>
            <h3>{props.title}</h3>
            <ul>
                {
                    props.data.map((lang)=>(
                        <li key="lang.english_name">{lang.name}</li>
                    ))
                }

            </ul>
        </div>
    )
}

export default List;
